import Sidebar from './components/sidebar/sidebar.component'
import Introduction from './components/introduction/introduction.component'
import { GlobalStyle } from './global.styles'
import { ContentContainer, MainContainer, SidebarContainer } from './App.styles'

function App() {
  return (
    <div>
      <GlobalStyle />
      <MainContainer>
        <SidebarContainer>
          <Sidebar />
        </SidebarContainer>
        <ContentContainer>
          <Introduction />
        </ContentContainer>
      </MainContainer>
    </div>
  );
}

export default App;
